?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Вряд ли кто-то из любителей часового искусства не слышал об этой знаменитейшей компании. И действительно, ведь эта компания производит не часы, она производит шедевры искусства. Стоит ли говорить, что это за компания, если для покупки некоторых моделей часов, Вам будет необходимо явиться на собеседование с Филиппом Штерном (глава компании) и убедить его в том, что Вам необходимы эти часы, и Вы будете за ними правильно ухаживать. Вот только после этих действий, Вы все равно не сможете купить часы Patek Philippe. Вы всего лишь попадете в список людей, которые хотят заполучить эти часы, и будете дожидаться своей очереди (причем, неизвестно, сколько ждать может месяц, может несколько лет). Эта знаменитая компания была основана в 1839 году. Ее основатели Антоний Патек и Франциск Чапек были польскими эмигрантами. Изначально, мастера компании производили всего лишь 200 часов в год. Но по мере того, как компания росла, увеличивался и рост производства и, соответственно, продажи. Компании Patek Philippe принадлежат многочисленное количество инновационных разработок, которые прежде не были реализованы в наручных или карманных часах. За всю свою историю компания поменяла множество владельцев и претерпевала многочисленные изменения (стоит отметить, что за весь свой период существования, Patek Philippe выпустила около 600 тысяч часов). Кроме того, этой компании принадлежит еще один рекорд их модель часов была продана по рекордной цене в 11 миллионов долларов. Стоит ли еще что-то говорить, чтобы понять, насколько знаменита эта компания?</span></span></p>
